import React from 'react';
import pic01 from '../images/room1.jpeg'
import pic02 from '../images/room2.webp'
import pic03 from '../images/room3.webp'

import Slider from './Slider'; // Import the Slider component


const Features = () => {
  return (
    <div id="features-wrapper">
    <div className="container">
      <div className="row">
        <div className="col-12">
          {/* Create a container for sliding div elements */}
          <div className="slider-container">
            {/* Individual feature divs that will slide */}
            <div className="slider-element">
              <a href="#" className="image featured">
                <img src={pic01} alt="" />
              </a>
              <div className="inner">
                <header>
                  <h2>1234 Elm Street, Los Angeles, CA 90001, USA</h2>
                  <p>$1,000/mo</p>
                </header>
                <p>"Charming bungalow with vintage appeal, nestled in a quiet neighborhood. Cozy and comfortable living awaits."</p>
              </div>
            </div>
            {/* Repeat similar divs for other features (pic02, pic03, etc.) */}
          </div>
        </div>
      </div>
    </div>
    {/* Include the Slider component here if needed */}
  </div>
);
};

export default Features;
